                    "data": "\u60a8\u53ef\u80fd\u6709\u4e00\u6bb5\u65f6\u95f4\u6ca1\u6709\u5728\u610f\u8fc7\u63d0\u53d6\u673a\u4e86.\u60a8\u7684\u84b8\u6c7d\u63d0\u53d6\u673a\u662f\u5426\u8fd8\u5728\u67d0\u4e2a\u5730\u65b9\u79ef\u7070?\u597d\u5427.\u4f46\u5982\u679c\u60a8\u9700\u8981\u5feb\u901f\u63d0\u53d6\u7269\u54c1(\u53ef\u80fd\u662f\u5904\u7406\u6210\u5428\u82b1?),\u4f7f\u7528\u5256\u6790\u63d0\u53d6\u88c5\u7f6e\u597d\u4e86.</br></br>[note]\u6839\u636e\u7ba1\u9053\u65b9\u5757\u7684\u4e0d\u540c\u7b49\u7ea7\u83b7\u53d6\u66f4\u591a\u7684\u5e76\u884c,\u56e0\u6b64\u5c3d\u91cf\u4f7f\u7528\u60a8\u80fd\u5236\u4f5c\u7684\u6700\u597d\u7684\u7ba1\u9053\u65b9\u5757.[/note]",
