                    "data": "\u5bf9\u4e8e\u4e00\u4e2a\u9700\u8981\u70bc\u5236\u00a7l\u8352\u5510\u00a7r\u6570\u91cf\u6750\u6599\u7684\u4eba\u6765\u8bf4,\u8fd9\u53f0\u673a\u5668\u662f\u5b8c\u7f8e\u7684.  \u8fd9\u4e2a\u673a\u5668\u602a\u517d\u53ef\u4ee5\u540c\u65f6\u5904\u7406256\u4e2a\u914d\u65b9.</br></br>\u73bb\u7483\u7b49\u7ea7(\u6bd4\u5982\u5728NEI\u641c\u7d22\"\u73bb\u7483\u7b49\u7ea7:HV\")\u9650\u5236\u4e86\u8fd9\u53f0\u673a\u5668\u7684\u6700\u9ad8\u80fd\u6e90\u4ed3\u7b49\u7ea7.\u4f60\u751a\u81f3\u53ef\u4ee5\u4f7f\u7528TecTech\u7684\u591aA\u80fd\u6e90\u4ed3! </br></br>\u8bd1\u8005\u6ce8:\u8fd8\u53ef\u4ee5\u7528\u526a\u7ebf\u94b3\u53f3\u952e\u4e3b\u65b9\u5757\u542f\u7528\u72ec\u7acb\u8f93\u5165\u603b\u7ebf\u529f\u80fd.",
