                    "data": "\u70bd\u7131\u9ad8\u7089\u80fd\u4ee5\u96be\u4ee5\u7f6e\u4fe1\u7684\u901f\u5ea6\u5904\u7406\u7269\u54c1. \u60f3\u8981\u6b63\u5e38\u4f7f\u7528\u8fd9\u53f0\u673a\u5668,\u4f60\u9700\u8981\u7ed9\u5b83\u6301\u7eed\u4f9b\u5e94\u70c8\u7130\u4e4b\u70bd\u7131,\u8fd8\u5f97\u914d\u4e0a\u597d\u7684\u7ebf\u5708.</br></br>[note]\u8fd9\u53f0\u591a\u65b9\u5757\u673a\u5668\u53ef\u4ee5\u5728IV\u9636\u6bb5\u5236\u9020,\u4f46\u9700\u8981\u4e24\u4e2aZPM\u7535\u8def\u677f.[/note]</br></br>\u8bd1\u8005\u6ce8:\u70bd\u7131\u9ad8\u7089\u6ca1\u6709\u7535\u538b\u7b49\u7ea7\u5e26\u6765\u7684\u989d\u5916\u7089\u6e29\u5956\u52b1,\u5176\u4f59\u673a\u5236\u548c\u5de5\u4e1a\u9ad8\u7089\u4e00\u81f4.",
