                    "data": "\u5728\u4f60\u5904\u7406\u88c2\u89e3\u71c3\u6599\u6216\u70ed\u89e3\u7089\u914d\u65b9\u65f6,\u8fd9\u4e2a\u72e0\u89d2\u8272\u4f1a\u6781\u5927\u5730\u63d0\u9ad8\u526f\u4ea7\u7387.\u5982\u6b64\u4e00\u6765\u4f60\u5c31\u53ef\u4ee5\u66f4\u6709\u6548\u7387\u7684\u5236\u9020\u5de5\u4e1aTNT\u3001\u5851\u6599\u3001\u805a\u56db\u6c1f\u4e59\u70ef,\u4ee5\u53ca\u5176\u4ed6\u5851\u6599\u4ea7\u54c1.\u4f60\u4e5f\u9700\u8981\u8fd9\u53f0\u673a\u5668\u6765\u5b8c\u6210\u4f60\u7684\u94c2\u7ebf.</br></br>\u4f60\u9700\u8981\u5728\u8d85\u51c0\u95f4\u4e2d\u5236\u9020EV\u7535\u8def\u677f,\u7136\u540e\u624d\u80fd\u5236\u505a\u8fd9\u53f0\u673a\u5668.</br></br>\u81f3\u4e8e\u4ed3\u5ba4,\u4f60\u53ef\u4ee5\u81ea\u7531\u9009\u62e9.\u4e00\u4e2aMV\u80fd\u6e90\u4ed3\u5c31\u53ef\u4ee5\u80dc\u4efb\u5927\u591a\u6570\u6709\u7528\u7684\u914d\u65b9.\u4e24\u4e2aMV\u80fd\u6e90\u4ed3\u6216\u8005\u4e00\u4e2aHV\u80fd\u6e90\u4ed3\u5c31\u53ef\u4ee5\u8986\u76d6\u9664\u4e86\u6c61\u67d3\u7269\u6216\u4e19\u916e\u5916\u51e0\u4e4e\u6240\u6709\u7684\u914d\u65b9.</br></br>\u4f60\u8fd8\u9700\u8981\u4e00\u4e2a\u8f93\u5165\u4ed3\u3001\u81f3\u5c11\u4e94\u4e2a\u8f93\u51fa\u4ed3,\u4ee5\u53ca\u4e00\u4e2a\u8f93\u51fa\u603b\u7ebf\u7528\u4e8e\u6536\u96c6\u90a3\u4e9b\u56fa\u4f53\u4ea7\u51fa.</br></br>[note]PS\uff1a\u6211\u5728\u6570\u636e\u8868\u683c\u91cc\u5217\u51fa\u4e86\u6240\u6709\u7684\u84b8\u998f\u5854\u914d\u65b9,\u8fd9\u6837\u4f60\u67e5\u770b\u8d77\u6765\u4f1a\u66f4\u52a0\u65b9\u4fbf. \u73b0\u5728\u4f60\u53ef\u4ee5\u8f7b\u6613\u6bd4\u8f83\u9009\u62e9\u5904\u7406\u77f3\u6cb9\u7684\u8def\u7ebf\u4e86![/note]",
