                    "symbol": "image://version/272/quests_icons/QuestIcon/-9206015034842694688.png",
                    "x": 144.0,
                    "y": 12.0,
                    "data": "\u538c\u5026\u4e86\u4e0d\u505c\u66f4\u6362\u900f\u955c, \u6216\u8005\u5f80\u8d85\u51c0\u95f4\u91cc\u585e\u5341\u51e0\u53f0\u6fc0\u5149\u8680\u523b\u673a? \u9ad8\u5f3a\u5ea6\u6fc0\u5149\u8680\u523b\u673a\u6b63\u662f\u4f60\u6240\u9700\u8981\u7684. \u8fd9\u53f0\u591a\u65b9\u5757\u80fd\u591f\u5904\u7406\u4f60\u6240\u6709\u7684\u6fc0\u5149\u8680\u523b\u9700\u6c42.</br></br>\u901a\u8fc7\u5728\u7ed3\u6784\u4e2d\u4f7f\u7528\u66f4\u5f3a\u5927\u7684\u00a7l\u6fc0\u5149\u6e90\u4ed3\u00a7r, \u4f60\u53ef\u4ee5\u83b7\u5f97\u66f4\u591a\u7684\u5e76\u884c\u5e76\u5904\u7406\u66f4\u9ad8\u7b49\u7ea7\u7684\u914d\u65b9. </br></br>[note]\u8fd9\u53f0\u591a\u65b9\u5757\u00a7o\u5fc5\u987b\u00a7r\u4f7f\u7528\u787c\u73bb\u7483 - \u8bf7\u9605\u8bfbtooltip![/note]",
