                    "data": "\u60a8\u73b0\u5728\u5e94\u8be5\u5df2\u7ecf\u6536\u96c6\u4e86\u4e0d\u5c11\u5355\u65b9\u5757\u84b8\u6c7d\u673a\u5668.\u867d\u7136\u8fd9\u4e9b\u673a\u5668\u53ef\u4ee5\u5e2e\u52a9\u60a8\u5904\u7406\u5c11\u91cf\u6750\u6599,\u4f46\u603b\u6709\u4e00\u5929\u60a8\u9700\u8981\u5904\u7406\u5927\u91cf\u7269\u54c1.\u8fd9\u5c31\u662f\u84b8\u6c7d\u591a\u65b9\u5757\u673a\u5668\u53d1\u6325\u4f5c\u7528\u7684\u5730\u65b9.</br></br>\u867d\u7136\u591a\u65b9\u5757\u84b8\u6c7d\u673a\u5668\u7684\u6750\u6599\u6210\u672c\u8fdc\u9ad8\u4e8e\u5355\u65b9\u5757,\u4f46\u5b83\u4eec\u4e5f\u6709\u4e00\u4e9b\u4f18\u52bf\uff1a\u5b83\u4eec\u4f7f\u7528\u7684\u84b8\u6c7d\u66f4\u5c11,\u800c\u4e14\u53ef\u4ee5\u5e76\u884c\u5904\u7406\u914d\u65b9,\u8fd9\u610f\u5473\u7740\u5982\u679c\u63d0\u4f9b\u7684\u84b8\u6c7d\u8db3\u591f,\u4e00\u4e2a\u914d\u65b9\u5faa\u73af\u53ef\u4ee5\u540c\u65f6\u5236\u4f5c\u591a\u4e2a\u7269\u54c1.</br></br>\u00a7T\u4e0d\u8fc7,\u5b83\u4eec\u4e5f\u6709\u4e00\u4e9b\u9700\u8981\u6ce8\u610f\u7684\u602a\u7656\uff1a</br></br>-\u8fd9\u4e9b\u591a\u65b9\u5757\u9700\u8981\u00a74\u00a7l\u975e\u5e38\u7279\u6b8a\u00a7r\u7684I/O\u65b9\u5757,\u53ea\u80fd\u4f7f\u7528\u4efb\u52a1\u4e2d\u7684\u663e\u793a\u7684\u90a3\u4e9b\u65b9\u5757.</br></br>-\u5b83\u4eec\u6700\u591a\u53ef\u4ee5\u52a0\u5de58\u4ef6\u7269\u54c1,\u57fa\u7840\u7b49\u7ea7\u7684\u673a\u5668\u7531\u9752\u94dc\u5236\u6210,\u800c\u9ad8\u538b\u7b49\u7ea7\u7531\u94a2\u5236\u6210(\u67e5\u770bNEI\u4e2d\u7684\u591a\u65b9\u5757\u9884\u89c8,\u5b83\u4f1a\u663e\u793a\u4e0d\u540c\u7684\u7b49\u7ea7).</br>-\u5982\u679c\u4f60\u6b63\u5728\u770b\u7740\u63a7\u5236\u5668\u65b9\u5757,\u53ef\u4ee5\u901a\u8fc7WAILA\u67e5\u770b\u673a\u5668\u7684\u7b49\u7ea7\u548c\u5e76\u884c\u5904\u7406\u7684\u6570\u91cf.</br></br>\u00a7W[note]\u901a\u8fc7\u8fd9\u4e2a\u4efb\u52a1,\u4f60\u5df2\u7ecf\u5f00\u59cb\u4e86\u5927\u89c4\u6a21\u751f\u4ea7\u4e4b\u65c5.\u4e0d\u8fc7,\u5148\u522b\u9ad8\u5174\u5f97\u592a\u65e9.\u867d\u7136\u4e00\u4e9b\u591a\u65b9\u5757\u673a\u5668\u5728\u84b8\u6c7d\u65f6\u4ee3\u5c31\u53ef\u4ee5\u5236\u4f5c,\u4f46\u5927\u591a\u6570\u7684\u591a\u65b9\u5757\u673a\u5668\u8fd8\u662f\u53ea\u6709\u5728EV\u6216\u66f4\u9ad8\u7535\u538b\u7b49\u7ea7\u624d\u80fd\u89e3\u9501,\u5176\u4e2d\u4e5f\u5305\u62ec\u8fd9\u4e9b\u84b8\u6c7d\u591a\u65b9\u5757\u673a\u5668\u7684\u52a0\u5f3a\u7248.",
